    "bio": "\u041F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043B\u044C \u0440\u0443\u0441\u0441\u043A\u043E\u0439 \u0436\u0438\u0432\u043E\u043F\u0438\u0441\u0438, \u0432\u044B\u0434\u0430\u044E\u0449\u0438\u0439\u0441\u044F \u043C\u0430\u0440\u0438\u043D\u0438\u0441\u0442, \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u043E\u043D\u0435\u0440, \u043C\u0435\u0446\u0435\u043D\u0430\u0442. \u0416\u0438\u0432\u043E\u043F\u0438\u0441\u0435\u0446 \u0413\u043B\u0430\u0432\u043D\u043E\u0433\u043E \u043C\u043E\u0440\u0441\u043A\u043E\u0433\u043E \u0448\u0442\u0430\u0431\u0430, \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u0442\u0430\u0439\u043D\u044B\u0439 \u0441\u043E\u0432\u0435\u0442\u043D\u0438\u043A, \u0430\u043A\u0430\u0434\u0435\u043C\u0438\u043A \u0438 \u043F\u043E\u0447\u0451\u0442\u043D\u044B\u0439 \u0447\u043B\u0435\u043D \u0418\u043C\u043F\u0435\u0440\u0430\u0442\u043E\u0440\u0441\u043A\u043E\u0439 \u0410\u043A\u0430\u0434\u0435\u043C\u0438\u0438 \u0445\u0443\u0434\u043E\u0436\u0435\u0441\u0442\u0432 \u0432 \u0421\u0430\u043D\u043A\u0442-\u041F\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435, \u043F\u043E\u0447\u0451\u0442\u043D\u044B\u0439 \u0447\u043B\u0435\u043D \u0410\u043A\u0430\u0434\u0435\u043C\u0438\u0439 \u0445\u0443\u0434\u043E\u0436\u0435\u0441\u0442\u0432 \u0432 \u0410\u043C\u0441\u0442\u0435\u0440\u0434\u0430\u043C\u0435, \u0420\u0438\u043C\u0435, \u041F\u0430\u0440\u0438\u0436\u0435, \u0424\u043B\u043E\u0440\u0435\u043D\u0446\u0438\u0438 \u0438 \u0428\u0442\u0443\u0442\u0433\u0430\u0440\u0442\u0435. \u041D\u0430\u0438\u0431\u043E\u043B\u0435\u0435 \u0432\u044B\u0434\u0430\u044E\u0449\u0438\u0439\u0441\u044F \u0445\u0443\u0434\u043E\u0436\u043D\u0438\u043A \u0430\u0440\u043C\u044F\u043D\u0441\u043A\u043E\u0433\u043E \u043F\u0440\u043E\u0438\u0441\u0445\u043E\u0436\u0434\u0435\u043D\u0438\u044F XIX \u0432\u0435\u043A\u0430. \u0411\u0440\u0430\u0442 \u0430\u0440\u043C\u044F\u043D\u0441\u043A\u043E\u0433\u043E \u0438\u0441\u0442\u043E\u0440\u0438\u043A\u0430 \u0438 \u0430\u0440\u0445\u0438\u0435\u043F\u0438\u0441\u043A\u043E\u043F\u0430 \u0410\u0440\u043C\u044F\u043D\u0441\u043A\u043E\u0439 \u0410\u043F\u043E\u0441\u0442\u043E\u043B\u044C\u0441\u043A\u043E\u0439 \u0426\u0435\u0440\u043A\u0432\u0438 \u0413\u0430\u0431\u0440\u0438\u044D\u043B\u0430 \u0410\u0439\u0432\u0430\u0437\u043E\u0432\u0441\u043A\u043E\u0433\u043E. \u0411\u0443\u0434\u0443\u0447\u0438 \u0445\u0443\u0434\u043E\u0436\u043D\u0438\u043A\u043E\u043C \u0441 \u043C\u0438\u0440\u043E\u0432\u043E\u0439 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E\u0441\u0442\u044C\u044E, \u0418\u0432\u0430\u043D \u041A\u043E\u043D\u0441\u0442\u0430\u043D\u0442\u0438\u043D\u043E\u0432\u0438\u0447 \u0410\u0439\u0432\u0430\u0437\u043E\u0432\u0441\u043A\u0438\u0439 \u043F\u0440\u0435\u0434\u043F\u043E\u0447\u0438\u0442\u0430\u043B \u0436\u0438\u0442\u044C \u0438 \u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u043D\u0430 \u0441\u0432\u043E\u0435\u0439 \u0440\u043E\u0434\u0438\u043D\u0435 \u2014 \u0432 \u041A\u0440\u044B\u043C\u0443. \u0410\u0439\u0432\u0430\u0437\u043E\u0432\u0441\u043A\u0438\u0439 \u043D\u0430\u0438\u0431\u043E\u043B\u0435\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043D \u0441\u0432\u043E\u0438\u043C\u0438 \u043C\u043E\u0440\u0441\u043A\u0438\u043C\u0438 \u043F\u0435\u0439\u0437\u0430\u0436\u0430\u043C\u0438, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0441\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u044E\u0442 \u0431\u043E\u043B\u044C\u0448\u0435 \u043F\u043E\u043B\u043E\u0432\u0438\u043D\u044B \u0435\u0433\u043E \u0440\u0430\u0431\u043E\u0442. \u0425\u0443\u0434\u043E\u0436\u043D\u0438\u043A \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044F \u043E\u0434\u043D\u0438\u043C \u0438\u0437 \u0432\u0435\u043B\u0438\u0447\u0430\u0439\u0448\u0438\u0445 \u043C\u0430\u0440\u0438\u043D\u0438\u0441\u0442\u043E\u0432 \u0432\u0441\u0435\u0445 \u0432\u0440\u0435\u043C\u0451\u043D.",
